import React from 'react'

export default function FetchJoke() {
  const getJoke =()=>{
    fetch("https://official-joke-api.appspot.com/random_joke").then(
        (response)=>response.json())
  }
  return (
    <div>
        <button onClick={getJoke}>Generate Joke</button>
    </div>
  )
}
